import Header from "./components/header";
import LeftSection from "./components/leftSection";
import RightSection from "./components/rightSection";


const MainMenu = () => {
  return (
    <div className="App">
      <div className="rightSide">
      <Header />
      <LeftSection name='gigi' />
      </div>
      <RightSection />
    </div>
  );
}

export default MainMenu;
